import React, { useState, useEffect } from 'react';
import { Outlet } from 'react-router-dom';
import Navbar from './components/Navbar';

function Main() {
  const [fullnames, setFullNames] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/data')
      .then((res) => res.json())
      .then((data) => setFullNames(data))
      .catch((error) => console.log(`Your error: ${error}`));
  }, []);


  function filteredNames(fullNames, searchTerm) {
    return fullNames.filter((name) => {
      const fullName = `${name.firstname} ${name.lastname}`.toLowerCase();
      const normalizedSearchTerm = searchTerm.toLowerCase();
      return fullName.includes(normalizedSearchTerm);
    });
  }














  return (
    <div>
      <header>
        <Navbar />
      </header>
      <Outlet context={{ filteredNames, setFullNames }} />
    </div>
  );
}

export default Main;
